import React from "react";
import "./App.css";
import Navbar from "./components/Navbar";
import {
  BrowserRouter as Router,
  Switch,
  Route,
  BrowserRouter,
} from "react-router-dom";
import Dashboard from "./pages/Dashboard";
import Charts from "./pages/Charts";
import History from "./pages/History";
import About from "./pages/About";

function App() {
  return (
    <BrowserRouter>
      <Router>
        <Navbar />
        <Switch>
          <Route path="/budget-tracker-v1/" exact component={Dashboard} />
          <Route path="/budget-tracker-v1/charts" component={Charts} />
          <Route path="/budget-tracker-v1/history" component={History} />
          <Route path="/budget-tracker-v1/about" component={About} />
        </Switch>
      </Router>
    </BrowserRouter>
  );
}

export default App;
